import React from 'react';
import { Redirect, Link } from 'react-router-dom';


const Header = (props) => {
  return (
    <div className='navbar'>

      <div className='header'>
        Books App (not Amazon duh!)
      </div>

      <nav>

        <div onClick={(e) => {
          <Redirect to='/' />
        }}>
          <h3> Home </h3>
        </div>

        <Link to='/newbook'>
          <h3>Add New Book</h3>
        </Link>

        <Link to='/login'>
          <h3>Login</h3>
        </Link>

      </nav>
    </div>
  )
}

export default Header;
